<div id="link-container"></div>

<script>
  const baseURL = "https://filedn.com/lIjlWL0OeLCYAVk44ciOJCX/output_images/";
  const files = [
    "ABT_PG.html",
    "ALB_W.html",
    "BA_ADBE.html",
    "BA_CRM.html",
    "BA_V.html",
    "BA_W.html",
    "BIDU_ALB.html",
    "BIDU_BA.html",
    "BIDU_V.html",
    "BIDU_W.html",
    "MMM_ADBE.html",
    "MMM_BA.html",
    "MMM_BX.html",
    "MMM_PEP.html",
    "TGT_IBM.html",
    "V_ABT.html",
    "V_CRM.html",
    "V_QCOM.html",
  ];

  const container = document.getElementById("link-container");

  files.forEach(file => {
    const link = document.createElement("a");
    link.href = baseURL + file;
    link.textContent = file;
    link.target = "_blank";
    container.appendChild(link);
    container.appendChild(document.createElement("br"));
  });
</script>
